"use client"

import { useState, useEffect } from "react"
import "../App.css"


const AdminReports = () => {
  const [reports, setReports] = useState([])
  const [loading, setLoading] = useState(true)

  useEffect(() => {
    fetchReports()
  }, [])

  const fetchReports = async () => {
    try {
      const token = localStorage.getItem("token")
      const response = await fetch("/api/admin/reports", {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      })

      if (response.ok) {
        const data = await response.json()
        setReports(data)
      }
    } catch (error) {
      console.error("Error fetching reports:", error)
    } finally {
      setLoading(false)
    }
  }

  const resolveReport = async (reportId, status, action = null) => {
    try {
      const token = localStorage.getItem("token")
      const response = await fetch(`/api/admin/reports/${reportId}/resolve`, {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify({ status, action }),
      })

      if (response.ok) {
        fetchReports()
        alert("Reporte resuelto correctamente")
      } else {
        alert("Error al resolver el reporte")
      }
    } catch (error) {
      console.error("Error resolving report:", error)
      alert("Error al resolver el reporte")
    }
  }

  if (loading) {
    return <div className="admin-loading">Cargando reportes...</div>
  }

  return (
    <div className="admin-reports">
      <div className="admin-header">
        <h1>Reportes de Contenido</h1>
        <p>{reports.length} reportes pendientes</p>
      </div>

      <div className="reports-list">
        {reports.length === 0 ? (
          <div className="no-reports">No hay reportes pendientes</div>
        ) : (
          reports.map((report) => (
            <div key={report.id} className="report-card">
              <div className="report-header">
                <span className="report-type">{report.reported_type}</span>
                <span className="report-date">{new Date(report.created_at).toLocaleDateString()}</span>
              </div>

              <div className="report-content">
                <p>
                  <strong>Reportado por:</strong> {report.reporter_username}
                </p>
                <p>
                  <strong>Razón:</strong> {report.reason}
                </p>
                {report.description && (
                  <p>
                    <strong>Descripción:</strong> {report.description}
                  </p>
                )}
                {report.reported_content && (
                  <div className="reported-content">
                    <strong>Contenido reportado:</strong>
                    <div className="content-preview">{report.reported_content}</div>
                  </div>
                )}
              </div>

              <div className="report-actions">
                <button className="action-btn dismiss" onClick={() => resolveReport(report.id, "dismissed")}>
                  Descartar
                </button>
                <button className="action-btn resolve" onClick={() => resolveReport(report.id, "resolved")}>
                  Resolver
                </button>
                <button
                  className="action-btn delete"
                  onClick={() => resolveReport(report.id, "resolved", "delete_content")}
                >
                  Eliminar Contenido
                </button>
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  )
}

export default AdminReports
